r.'=>'HTTP %d ભૂલ.','PHP OpenSSL Extension missing'=>'PHP OpenSSL એક્સટેન્શન ખૂટે છે','PHP OpenSSL Extension installed'=>'PHP OpenSSL એક્સ્ટેંશન ઇન્સ્ટોલ કર્યું','SEO Score: Ok'=>'SEO સ્કોર: ઠીક છે','Please activate Web Stories plugin to use this module.'=>'આ મોડ્યુલનો ઉપયોગ કરવા માટે કૃપા કરીને વેબ સ્ટોરીઝ પ્લગઇન સક્રિય કરો.','Make any Story created with the Web Stories WordPress plugin SEO-Ready with automatic support for Schema and Meta tags.'=>'વેબ સ્ટોરીઝ વર્ડપ્રેસ પ્લગઇન સાથે બનાવેલી કોઈપણ વાર્તાને સ્કીમા અને મેટા ટેગ માટે ઓટોમેટિક સપોર્ટ સાથે SEO-રેડી બનાવો.','Google Web Stories'=>'ગૂગલ વેબ સ્ટોરીઝ','Disconnect Account'=>'એકાઉન્ટને ડિસ્કનેક્ટ કરો','Connect Now'=>'હમણાં જોડાઓ','The plugin is currently not connected with your Rank Math account. Click on the button below to login or register for FREE using your %1$sGoogle account, Facebook account%2$s or %1$syour email account%2$s.'=>'આ પ્લગઇન હાલમાં તમારા રેન્ક મેથ એકાઉન્ટ સાથે જોડાયેલ નથી. તમારા %1$sGoogle એકાઉન્ટ, Facebook એકાઉન્ટ%2$s અથવા %1$s તમારા ઇમેઇલ એકાઉન્ટ%2$s નો ઉપયોગ કરીને મફતમાં લોગ ઇન કરવા અથવા નોંધણી કરાવવા માટે નીચેના બટન પર ક્લિક કરો.','Not Connected'=>'જોડાયેલ નથી','Connected'=>'જોડાયેલું છે','Account'=>'ખાતું','Please activate the WPML String Translation plugin to convert Rank Math Setting values in different languages.'=>'રેન્ક મેથ સેટિંગ મૂલ્યોને વિવિધ ભાષાઓમાં કન્વર્ટ કરવા માટે કૃપા કરીને WPML સ્ટ્રિંગ ટ્રાન્સલેશન પ્લગઇન સક્રિય કરો.','PHP MBstring Extension missing'=>'PHP MBstring એક્સ્ટેંશન ખૂટે છે','PHP MBstring Extension installed'=>'PHP MBstring એક્સ્ટેંશન ઇન્સ્ટોલ કર્યું','Read more by following this link.'=>'આ કડીને અનુસરીને વધુ વાંચો.','By connecting your free account, you get keyword suggestions directly from Google when entering the focus keywords. Not only that, get access to our revolutionary Content AI, SEO Analyzer inside WordPress that scans your website for SEO errors and suggest improvements. %s'=>'તમારા ફ્રી એકાઉન્ટને કનેક્ટ કરીને, ફોકસ કીવર્ડ દાખલ કરતી વખતે તમે સીધા Google તરફથી કીવર્ડ સૂચનો મેળવો છો. એટલું જ નહીં, અમારી ક્રાંતિકારી સામગ્રી AI, WordPress ની અંદર SEO વિશ્લેષકની ઍક્સેસ મેળવો જે SEO ભૂલો માટે તમારી વેબસાઇટને સ્કેન કરે છે અને સુધારાઓ સૂચવે છે. %s','Custom values for robots meta tag on %s archives.'=>'%s આર્કાઇવ્સ પર રોબોટ્સ મેટા ટેગ માટે કસ્ટમ મૂલ્યો.','Custom values for robots meta tag on %s.'=>'%s પર રોબોટ્સ મેટા ટેગ માટે કસ્ટમ મૂલ્યો.','Custom Mode %s'=>'કસ્ટમ મોડ %s','For the advanced users who want to control every SEO aspect of the website. You are offered options to change everything and have full control over the website’s SEO.'=>'વેબસાઇટના દરેક SEO પાસાને નિયંત્રિત કરવા માંગતા અદ્યતન વપરાશકર્તાઓ માટે. તમને બધું બદલવા અને વેબસાઇટના SEO પર સંપૂર્ણ નિયંત્રણ રાખવાના વિકલ્પો આપવામાં આવે છે.','Advanced %s'=>'ઉન્નત %s','For websites where you only want to change the basics and let Rank Math do most of the heavy lifting. Most settings are set to default as per industry best practices. One just has to set it and forget it.'=>'એવી વેબસાઇટ્સ માટે જ્યાં તમે ફક્ત મૂળભૂત બાબતોમાં ફેરફાર કરવા માંગો છો અને મોટાભાગનું ભારે કામ રેન્ક મેથને કરવા દો છો. ઉદ્યોગની શ્રેષ્ઠ પ્રથાઓ અનુસાર મોટાભાગની સેટિંગ્સ ડિફોલ્ટ પર સેટ કરેલી છે. વ્યક્તિએ ફક્ત તેને સેટ કરીને ભૂલી જવું પડશે.','Easy %s'=>'સરળ %s','Image Preview'=>'છબી પૂર્વાવલોકન','Video Preview'=>'વિડિઓ પૂર્વાવલોકન','Snippet'=>'સ્નિપેટ','Change Global SEO, Schema, and other settings for %1$s. %2$s'=>'%1$s માટે ગ્લોબલ SEO, સ્કીમા અને અન્ય સેટિંગ્સ બદલો. %2$s','Customize SEO meta settings of pages like search results, 404s, etc. %s.'=>'શોધ પરિણામો, 404s, વગેરે જેવા પૃષ્ઠોની SEO મેટા સેટિંગ્સને કસ્ટમાઇઝ કરો. %s.','Change SEO options related to the author archives. %s.'=>'લેખક આર્કાઇવ્સ સંબંધિત SEO વિકલ્પો બદલો. %s.','Add SEO meta and OpenGraph details to your homepage. %s.'=>'તમારા હોમપેજ પર SEO મેટા અને ઓપનગ્રાફ વિગતો ઉમેરો. %s.','Use the <code>[rank_math_contact_info]</code> shortcode to display contact information in a nicely formatted way. You should also claim your business on Google if you have not already.'=>'સંપર્ક માહિતીને સરસ રીતે ફોર્મેટ કરેલી રીતે પ્રદર્શિત કરવા માટે <code>[rank_math_contact_info]</code> શોર્ટકોડનો ઉપયોગ કરો. જો તમે પહેલાથી જ Google પર તમારા વ્યવસાયનો દાવો ન કર્યો હોય, તો તમારે પણ તે કરવો જોઈએ.','Optimize for local searches and Knowledge Graph using these settings. %s.'=>'આ સેટિંગ્સનો ઉપયોગ કરીને સ્થાનિક શોધ અને જ્ઞાન ગ્રાફ માટે ઑપ્ટિમાઇઝ કરો. %s.','Change Global meta settings that take effect across your website. %s.'=>'તમારી વેબસાઇટ પર લાગુ થતી વૈશ્વિક મેટા સેટિંગ્સ બદલો. %s.','Edit the contents of your .htaccess file easily. %s.'=>'તમારી .htaccess ફાઇલની સામગ્રી સરળતાથી સંપાદિત કરો. %s.','Change some uncommon but essential settings here. %s.'=>'અહીં કેટલીક અસામાન્ય પણ આવશ્યક સેટિંગ્સ બદલો. %s.','Enter verification codes for third-party webmaster tools. %s'=>'તૃતીય-પક્ષ વેબમાસ્ટર સાધનો માટે ચકાસણી કોડ દાખલ કરો. %s','Use the following code in your theme template files to display breadcrumbs.'=>'બ્રેડક્રમ્સ પ્રદર્શિત કરવા માટે તમારી થીમ ટેમ્પલેટ ફાઇલોમાં નીચેના કોડનો ઉપયોગ કરો.','Here you can set up the breadcrumbs function. %s'=>'અહીં તમે બ્રેડક્રમ્સ ફંક્શન સેટ કરી શકો છો. %s','Change how some of the links open and operate on your website. %s.'=>'તમારી વેબસાઇટ પર કેટલીક લિંક્સ કેવી રીતે ખુલે છે અને કાર્ય કરે છે તે બદલો. %s.','Advanced Mode'=>'એડવાન્સ્ડ મોડ','Easy Mode'=>'સરળ મોડ','Optimize WooCommerce Pages for Search Engines by adding required metadata and Product Schema which will make your site stand out in the SERPs.'=>'જરૂરી મેટાડેટા અને પ્રોડક્ટ સ્કીમા ઉમેરીને સર્ચ એન્જિન માટે WooCommerce પૃષ્ઠોને ઑપ્ટિમાઇઝ કરો જે તમારી સાઇટને SERPs માં અલગ બનાવશે.','Install %s to make Rank Math work with Accelerated Mobile Pages. Rank Math automatically adds required meta tags in all the AMP pages.'=>'એક્સિલરેટેડ મોબાઇલ પેજીસ સાથે રેન્ક મેથ કાર્યરત કરવા માટે %s ઇન્સ્ટોલ કરો. રેન્ક મેથ આપમેળે બધા AMP પેજમાં જરૂરી મેટા ટેગ ઉમેરે છે.','The Role Manager allows you to use WordPress roles to control which of your site users can have edit or view access to Rank Math\'s settings.'=>'રોલ મેનેજર તમને WordPress ભૂમિકાઓનો ઉપયોગ કરીને તમારા કયા સાઇટ વપરાશકર્તાઓને રેન્ક મેથની સેટિંગ્સમાં સંપાદન અથવા દૃશ્ય ઍક્સેસ હોઈ શકે છે તે નિયંત્રિત કરવાની મંજૂરી આપે છે.','Advanced Image SEO options to supercharge your website. Automate the task of adding the ALT and Title tags to your images on the fly.'=>'તમારી વેબસાઇટને સુપરચાર્જ કરવા માટે એડવાન્સ્ડ ઇમેજ SEO વિકલ્પો. તમારી છબીઓમાં ALT અને Title ટૅગ્સ ઉમેરવાનું કાર્ય તરત જ સ્વચાલિત કરો.','Image SEO'=>'છબી SEO','Counts the total number of internal, external links, to and from links inside your posts. You can also see the same count in the Posts List Page.'=>'તમારી પોસ્ટની અંદરની અને તેની અંદરની લિંક્સની આંતરિક, બાહ્ય લિંક્સની કુલ સંખ્યાની ગણતરી કરે છે. તમે પોસ્ટ સૂચિ પૃષ્ઠમાં પણ સમાન સંખ્યા જોઈ શકો છો.','Enable Rank Math\'s sitemap feature, which helps search engines intelligently crawl your website\'s content. It also supports hreflang tag.'=>'રેન્ક મેથની સાઇટમેપ સુવિધાને સક્ષમ કરો, જે શોધ એન્જિનને તમારી વેબસાઇટની સામગ્રીને બુદ્ધિપૂર્વક ક્રોલ કરવામાં મદદ કરે છે. તે hreflang ટેગને પણ સપોર્ટ કરે છે.','Redirect non-existent content easily with 301 and 302 status code. This can help improve your site ranking. Also supports many other response codes.'=>'301 અને 302 સ્ટેટસ કોડ વડે અવિદ્યમાન સામગ્રીને સરળતાથી રીડાયરેક્ટ કરો. આ તમારી સાઇટ રેન્કિંગને સુધારવામાં મદદ કરી શકે છે. અન્ય ઘણા પ્રતિભાવ કોડને પણ સપોર્ટ કરે છે.','Dominate the search results for the local audiences by optimizing your website for Local SEO and it also helps you to aquire the Knowledge Graph.'=>'સ્થાનિક એસઇઓ માટે તમારી વેબસાઇટને ઑપ્ટિમાઇઝ કરીને સ્થાનિક પ્રેક્ષકો માટે શોધ પરિણામો પર પ્રભુત્વ મેળવો અને તે તમને નોલેજ ગ્રાફ મેળવવામાં પણ મદદ કરે છે.','read here'=>'અહીં વાંચો','Rank Math generates the default Sitemaps only and WPML takes care of the rest. When a search engine bot visits any post/page, it is shown hreflang tag that helps it crawl the translated pages. This is one of the recommended methods by Google. Please %s'=>'રેન્ક મેથ ફક્ત ડિફૉલ્ટ સાઇટમેપ્સ જનરેટ કરે છે અને WPML બાકીની કાળજી લે છે. જ્યારે સર્ચ એન્જિન બોટ કોઈપણ પોસ્ટ/પેજની મુલાકાત લે છે, ત્યારે તેને hreflang ટેગ બતાવવામાં આવે છે જે તેને અનુવાદિત પૃષ્ઠોને ક્રોલ કરવામાં મદદ કરે છે. આ Google દ્વારા ભલામણ કરાયેલ પદ્ધતિઓમાંની એક છે. કૃપા કરીને %s','Change Sitemap settings of %1$s. %2$s.'=>'%1$s ની સાઇટમેપ સેટિંગ્સ બદલો. %2$s.','Easily create redirects without fiddling with tedious code. %s.'=>'કંટાળાજનક કોડ સાથે હલચલ કર્યા વિના સરળતાથી રીડાયરેક્ટ બનાવો. %s','Monitor broken pages that ruin user-experience and affect SEO. %s.'=>'તૂટેલા પૃષ્ઠોનું નિરીક્ષણ કરો જે વપરાશકર્તા-અનુભવને બગાડે છે અને SEOને અસર કરે છે. %s','Conversion started. A success message will be shown here once the process completes. You can close this page.'=>'રૂપાંતર શરૂ થયું. એકવાર પ્રક્રિયા પૂર્ણ થયા પછી અહીં સફળતાનો સંદેશ બતાવવામાં આવશે. તમે આ પૃષ્ઠ બંધ કરી શકો છો.','WordPress Dashboard > Settings > Permalinks > Product permalinks Example: default: /product/accessories/action-figures/acme/ - becomes: /accessories/action-figures/acme/'=>'વર્ડપ્રેસ ડેશબોર્ડ > સેટિંગ્સ > પરમાલિંક્સ > પ્રોડક્ટ પરમાલિંક્સ ઉદાહરણ: ડિફોલ્ટ: /product/accessories/action-figures/acme/ - બને છે: /accessories/action-figures/acme/','Choose how you want Rank Math to handle your WooCommerce SEO. %s.'=>'તમે તમારા WooCommerce SEO ને કેવી રીતે હેન્ડલ કરવા માંગો છો તે પસંદ કરો. %s','Automatic updates are not enabled on your site. %s'=>'તમારી સાઇટ પર સ્વચાલિત અપડેટ્સ સક્ષમ નથી. %s','The error log cannot be retrieved: Error log file is too large.'=>'ભૂલ લોગ પુનઃપ્રાપ્ત કરી શકાતો નથી: ભૂલ લોગ ફાઇલ ખૂબ મોટી છે.','The error log cannot be retrieved.'=>'ભૂલ લોગ પુનઃપ્રાપ્ત કરી શકાતો નથી.','Edit your robots.txt file to control what bots see. %s.'=>'બોટ્સ શું જુએ છે તે નિયંત્રિત કરવા માટે તમારી robots.txt ફાઇલમાં ફેરફાર કરો. %s.','Edit Page: '=>'પૃષ્ઠ સંપાદિત કરો:','Static page is set as the front page (WP Dashboard > Settings > Reading). To add SEO title, description, and meta for