ts page.'=>'શોધ પરિણામો પૃષ્ઠ પર શીર્ષક ટેગ.','Search Results Title'=>'શોધ પરિણામો શીર્ષક','Date archive description.'=>'તારીખ આર્કાઇવ વર્ણન.','Date Archive Description'=>'તારીખ આર્કાઇવ વર્ણન','Title tag on day/month/year based archives.'=>'દિવસ/મહિનો/વર્ષ આધારિત આર્કાઇવ્સ પર શીર્ષક ટેગ.','Date Archive Title'=>'તારીખ આર્કાઇવ શીર્ષક','Date Archives'=>'તારીખ આર્કાઇવ્સ','Image displayed when your homepage is shared on Facebook and other social networks. Use images that are at least 1200 x 630 pixels for the best display on high resolution devices.'=>'જ્યારે તમારું હોમપેજ Facebook અને અન્ય સામાજિક નેટવર્ક્સ પર શેર કરવામાં આવે ત્યારે છબી પ્રદર્શિત થાય છે. ઉચ્ચ રીઝોલ્યુશનવાળા ઉપકરણો પર શ્રેષ્ઠ પ્રદર્શન માટે ઓછામાં ઓછી 1200 x 630 પિક્સેલની છબીઓનો ઉપયોગ કરો.','Homepage Thumbnail for Facebook'=>'ફેસબુક માટે હોમપેજ થંબનેલ','Description of your site when shared on Facebook, Twitter and other social networks.'=>'Facebook, Twitter અને અન્ય સામાજિક નેટવર્ક્સ પર શેર કરવામાં આવે ત્યારે તમારી સાઇટનું વર્ણન.','Homepage Description for Facebook'=>'ફેસબુક માટે હોમપેજ વર્ણન','Title of your site when shared on Facebook, Twitter and other social networks.'=>'Facebook, Twitter અને અન્ય સામાજિક નેટવર્ક્સ પર શેર કરવામાં આવે ત્યારે તમારી સાઇટનું શીર્ષક.','Homepage Title for Facebook'=>'ફેસબુક માટે હોમપેજ શીર્ષક','Custom values for robots meta tag on homepage.'=>'હોમપેજ પર રોબોટ્સ મેટા ટેગ માટે કસ્ટમ મૂલ્યો.','Custom'=>'કસ્ટમ','Default'=>'ડિફોલ્ટ','Select custom robots meta for homepage, such as <code>nofollow</code>, <code>noarchive</code>, etc. Otherwise the default meta will be used, as set in the Global Meta tab.'=>'હોમપેજ માટે કસ્ટમ રોબોટ્સ મેટા પસંદ કરો, જેમ કે <code>nofollow</code>, <code>noarchive</code>, વગેરે. નહિંતર, ગ્લોબલ મેટા ટેબમાં સેટ કર્યા મુજબ, ડિફોલ્ટ મેટાનો ઉપયોગ કરવામાં આવશે.','Homepage Robots Meta'=>'મેટા રોબોટ્સ હોમપેજ','Homepage meta description.'=>'હોમપેજ મેટા વર્ણન.','Homepage Meta Description'=>'હોમપેજ મેટા વર્ણન','Homepage title tag.'=>'હોમપેજ શીર્ષક ટૅગ.','Homepage Title'=>'હોમપેજ શીર્ષક','Card type selected when creating a new post. This will also be applied for posts without a card type selected.'=>'નવી પોસ્ટ બનાવતી વખતે કાર્ડનો પ્રકાર પસંદ કર્યો. આ કાર્ડ પ્રકાર પસંદ કર્યા વિનાની પોસ્ટ્સ માટે પણ લાગુ થશે.','Twitter Card Type'=>'ટ્વિટર કાર્ડ પ્રકાર','OpenGraph Thumbnail'=>'ઓપનગ્રાફ થંબનેલ','Capitalize Titles'=>'શીર્ષકોને મોટા અક્ષરોમાં લખો','You can use the separator character in titles by inserting <code>%separator%</code> or <code>%sep%</code> in the title fields.'=>'તમે ટાઇટલ ફીલ્ડમાં <code>%separator%</code> અથવા <code>%sep%</code> દાખલ કરીને ટાઇટલમાં વિભાજક અક્ષરનો ઉપયોગ કરી શકો છો.','Default values for robots meta tag. These can be changed for individual posts, taxonomies, etc.'=>'રોબોટ્સ મેટા ટેગ માટે ડિફોલ્ટ મૂલ્યો. આ વ્યક્તિગત પોસ્ટ્સ, વર્ગીકરણ, વગેરે માટે બદલી શકાય છે.','Add SEO Controls for user profile pages. Access to the Meta Box can be fine tuned with code, using a special filter hook.'=>'વપરાશકર્તા પ્રોફાઇલ પૃષ્ઠો માટે SEO નિયંત્રણો ઉમેરો. વિશિષ્ટ ફિલ્ટર હૂકનો ઉપયોગ કરીને મેટા બોક્સની ઍક્સેસ કોડ સાથે સારી રીતે ટ્યુન કરી શકાય છે.','Author archive meta description. SEO options for specific author archives can be set with the meta box in the user profiles.'=>'લેખક આર્કાઇવ મેટા વર્ણન. ચોક્કસ લેખક આર્કાઇવ્સ માટે SEO વિકલ્પો વપરાશકર્તા પ્રોફાઇલ્સમાં મેટા બોક્સ સાથે સેટ કરી શકાય છે.','Author Archive Description'=>'લેખક આર્કાઇવ વર્ણન','Title tag on author archives. SEO options for specific authors can be set with the meta box available in the user profiles.'=>'લેખક આર્કાઇવ્સ પર શીર્ષક ટેગ. ચોક્કસ લેખકો માટે SEO વિકલ્પો વપરાશકર્તા પ્રોફાઇલ્સમાં ઉપલબ્ધ મેટા બોક્સ સાથે સેટ કરી શકાય છે.','Author Archive Title'=>'લેખક આર્કાઇવ શીર્ષક','Change the <code>/author/</code> part in author archive URLs.'=>'લેખક આર્કાઇવ URL માં <code>/author/</code> ભાગ બદલો.','Author Base'=>'લેખક આધાર','Enabled'=>'સક્ષમ','Disabled'=>'અક્ષમ','Author Archives'=>'લેખક આર્કાઇવ્ઝ','Norton Ownership Verification Page'=>'નોર્ટન માલિકી ચકાસણી પૃષ્ઠ','Enter your Norton Safe Web verification HTML code or ID. Learn how to get it: %s'=>'તમારો નોર્ટન સેફ વેબ વેરિફિકેશન HTML કોડ અથવા ID દાખલ કરો. તે કેવી રીતે મેળવવું તે જાણો: %s','Norton Safe Web Verification ID'=>'નોર્ટન સેફ વેબ વેરિફિકેશન ID','Pinterest Account'=>'પિન્ટેરેસ્ટ એકાઉન્ટ','Enter your Pinterest verification HTML code or ID. Learn how to get it: %s'=>'તમારો Pinterest વેરિફિકેશન HTML કોડ અથવા ID દાખલ કરો. તે કેવી રીતે મેળવવું તે જાણો: %s','Pinterest Verification ID'=>'પિન્ટેરેસ્ટ ચકાસણી ID','Yandex.Webmaster Page'=>'યાન્ડેક્સ. વેબમાસ્ટર પૃષ્ઠ','Enter your Yandex verification HTML code or ID. Learn how to get it: %s'=>'તમારો Yandex વેરિફિકેશન HTML કોડ અથવા ID દાખલ કરો. તે કેવી રીતે મેળવવું તે જાણો: %s','Yandex Verification ID'=>'યાન્ડેક્ષ ચકાસણી ID','Enter your Baidu Webmaster Tools verification HTML code or ID. Learn how to get it: %s'=>'તમારો Baidu વેબમાસ્ટર ટૂલ્સ વેરિફિકેશન HTML કોડ અથવા ID દાખલ કરો. તે કેવી રીતે મેળવવું તે જાણો: %s','Baidu Webmaster Tools'=>'Baidu વેબમાસ્ટર સાધનો','Bing Webmaster Verification Page'=>'Bing વેબમાસ્ટર ચકાસણી પૃષ્ઠ','Enter your Bing Webmaster Tools verification HTML code or ID. Get it here: %s'=>'તમારો Bing વેબમાસ્ટર ટૂલ્સ વેરિફિકેશન HTML કોડ અથવા ID દાખલ કરો. તેને અહીં મેળવો: %s','Bing Webmaster Tools'=>'Bing વેબમાસ્ટર સાધનો','Search Console Verification Page'=>'શોધ કન્સોલ ચકાસણી પૃષ્ઠ','Enter your Google Search Console verification HTML code or ID. Learn how to get it: %s'=>'તમારો Google શોધ કન્સોલ ચકાસણી HTML કોડ અથવા ID દાખલ કરો. તે કેવી રીતે મેળવવું તે જાણો: %s','Google Search Console'=>'ગૂગલ શોધ કન્સોલ','Featured image of the article.'=>'લેખની વૈશિષ્ટિકૃત છબી.','A link to your site, with your site\'s name and description as anchor text.'=>'તમારી સાઇટની લિંક, તમારી સાઇટના નામ અને એન્કર ટેક્સ્ટ તરીકે વર્ણન સાથે.','A link to your site, with your site\'s name as anchor text.'=>'તમારી સાઇટની લિંક, એન્કર ટેક્સ્ટ તરીકે તમારી સાઇટના નામ સાથે.','A link to the post, with the title as anchor text.'=>'એન્કર ટેક્સ્ટ તરીકે શીર્ષક સાથે પોસ્ટની લિંક.','A link to the archive for the post author, with the authors name as anchor text.'=>'એન્કર ટેક્સ્ટ તરીકે લેખકના નામ સાથે પોસ્ટ લેખક માટે આર્કાઇવની લિંક.','Variable'=>'ચલ','Available variables'=>'ઉપલબ્ધ ચલો','Contents are locked because a robots.txt file is present in the root folder.'=>'સામગ્રીઓ લૉક કરવામાં આવી છે કારણ કે રુટ ફોલ્ડરમાં robots.txt ફાઇલ હાજર છે.','Add content after each post in your site feeds.'=>'તમારી સાઇટ ફીડ્સમાં દરેક પોસ્ટ પછી સામગ્રી ઉમેરો.','RSS After Content'=>'સામગ્રી પછી RSS','Add content before each post in your site feeds.'=>'તમારી સાઇટ ફીડ્સમાં દરેક પોસ્ટ પહેલાં સામગ્રી ઉમેરો.','RSS Before Content'=>'સામગ્રી પહેલાં RSS','Automatically add <code>target="_blank"</code> attribute for external links appearing in your posts, pages, and other post types to make them open in a new browser tab or window. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'તમારી પોસ્ટ્સ, પૃષ્ઠો અને અન્ય પોસ્ટ પ્રકારોમાં દેખાતી બાહ્ય લિંક્સને નવા બ્રાઉઝર ટૅબ અથવા વિંડોમાં ખોલવા માટે ઑટોમૅટિક રીતે <code>target="_blank"</code> એટ્રિબ્યુટ ઉમેરો. જ્યારે સામગ્રી પ્રદર્શિત થાય છે ત્યારે વિશેષતા ગતિશીલ રીતે લાગુ થાય છે, અને સંગ્રહિત સામગ્રી બદલાતી નથી.','The <code>nofollow</code> attribute <strong>will not be added</strong> for the link if target domain is in this list. Add one per line.'=>'જો લક્ષ્ય ડોમેન આ સૂચિમાં હશે તો લિંક માટે <code>nofollow</code> વિશેષતા <strong>ઉમેરવામાં આવશે નહીં</strong>. લીટી દીઠ એક ઉમેરો.','Nofollow Exclude Domains'=>'Nofollow ડોમેન્સ બાકાત','Only add <code>nofollow</code> attribute for the link if target domain is in this list. Add one per line. Leave empty to apply nofollow for <strong>ALL</strong> external domains.'=>'જો લક્ષ્ય ડોમેન આ સૂચિમાં હોય તો જ લિંક માટે <code>nofollow</code> વિશેષતા ઉમેરો. લીટી દીઠ એક ઉમેરો. <strong>બધા</strong> બાહ્ય ડોમેન્સ માટે nofollow લાગુ કરવા માટે ખાલી છોડો.','Nofollow Domains'=>'નોફોલો ડોમેન્સ','Redirect attachments without a parent post to this URL. Leave empty for no redirection.'=>'આ URL પર પિતૃ પોસ્ટ વિના જોડાણોને રીડાયરેક્ટ કરો. કોઈ રીડાયરેશન માટે ખાલી છોડો.','Redirect all attachment page URLs to the post they appear in. For more advanced redirection control, use the built-in %s.'=>'બધા જોડાણ પૃષ્ઠ URL ને તેઓ જે પોસ્ટમાં દેખાય છે તેના પર રીડાયરેક્ટ કરો. વધુ અદ્યતન રીડાયરેકશન નિયંત્રણ માટે, બિલ્ટ-ઇન %s નો ઉપયોગ કરો.','Redirect Attachments'=>'જોડાણો રીડાયરેક્ટ કરો','Please enable Redirections module.'=>'કૃપા કરીને રીડાયરેક્શન મોડ્યુલને સક્ષમ કરો.','Redirections Manager'=>'મેનેજર રીડાયરેક્ટ કરે છે','Redirection Manager'=>'રીડાયરેક્શન મેનેજર','Why do this?'=>'આવું કેમ કરવું?','Remove /category/ from category archive URLs. %s <br>E.g. <code>example.com/category/my-category/</code> becomes <code>example.com/my-category</code>'=>'શ્રેણી આર્કાઇવ URL માંથી /category/ દૂર કરો. %s <br>દા.ત. <code>example.com/category/my-category/</code> બની જાય છે <code>example.com/my-category</code>','Format used for the new <code>title</code> attribute values.'=>'નવા <code>શીર્ષક</code> વિશેષતા મૂલ્યો માટે વપરાયેલ ફોર્મેટ.','Title attribute format'=>'શીર્ષક વિશેષતા ફોર્મેટ','Add <code>TITLE</code> attribute for all <code>images</code> without a <code>TITLE</code> attribute automatically. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'<code>TITLE</code> એટ્રિબ્યુટ વિના આપમેળે તમામ <code>છબીઓ</code> માટે <code>TITLE</code> વિશેષતા ઉમેરો. જ્યારે સામગ્રી પ્રદર્શિત થાય છે ત્યારે વિશેષતા ગતિશીલ રીતે લાગુ થાય છે, અને સંગ્રહિત સામગ્રી બદલાતી નથી.','Add missing TITLE attributes'=>'ગુમ થયેલ TITLE વિશેષતાઓ ઉમેરો','Format used for the new <code>alt</code> attribute values.'=>'નવા <code>alt</code> એટ્રિબ્યુટ મૂલ્યો માટે વપરાયેલ ફોર્મેટ.','Alt attribute format'=>'Alt એટ્રિબ્યુટ ફોર્મેટ','Add <code>alt</code> attributes for <code>images</code> without <code>alt</code> attributes automatically. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'<code>images</code> માટે <code>alt</code> એટ્રિબ્યુટ વિના ઑટોમૅટિક રીતે <code>alt</code> વિશેષતાઓ ઉમેરો. જ્યારે સામગ્રી પ્રદર્શિત થાય છે ત્યારે વિશેષતા ગતિશીલ રીતે લાગુ થાય છે, અને સંગ્રહિત સામગ્રી બદલાતી નથી.','Be careful when editing the htaccess file, it is easy to make mistakes and break your site. If that happens, you can restore the file to its state <strong>before the last edit</strong> by replacing the htaccess file with the backup copy created by Rank Math in the same directory (<em>.htaccess_back_xxxxxx</em>) using an FTP client.'=>'htaccess ફાઇલને સંપાદિત કરતી વખતે સાવચેત રહો, કારણ કે તેમાં ભૂલો થવી સરળ છે અને તમારી સાઇટ ખોરવી શકે. જો એવું થાય, તો તમે Rank Math દ્વારા બનાવેલી બેકઅપ કૉપીને ઉપયોગ કરીને htaccess ફાઇલને છેલ્લી સંપાદન પહેલાંની સ્થિતિ પર પુનઃસ્થાપિત કરી શકો. આ બેકઅપ ફાઇલ એ જ ડિરેક્ટરીમાં (<em>.htaccess_back_xxxxxx</em>) ઉપલબ્ધ છે, અને તેને FTP ક્લાયન્ટ દ્વારા બદલાવી શકાય છે.','I understand the risks and I want to edit the file'=>'હું જોખમોને સમજું છું અને હું ફાઇલમાં ફેરફાર કરવા માંગુ છું','.htaccess file is not writable.'=>'.htaccess ફાઇલ લખી શકાય તેવી નથી.','.htaccess file not found.'=>'.htaccess ફાઇલ મળી નથી.','Hide Taxonomy Name from Breadcrumb.'=>'બ્રેડક્રમ્બમાંથી વર્ગીકરણ નામ છુપાવો.','Hide Taxonomy Name'=>'વર્ગીકરણ નામ છુપાવો','If category is a child category, show all ancestor categories.'=>'જો કૅટેગરી બાળ કૅટેગરી છે, તો તમામ પૂર્વજ કૅટેગરી બતાવો.','Show Category(s)'=>'શ્રેણી(ઓ) બતાવો','Hide Post title from Breadcrumb.'=>'બ્રેડક્રમ્બમાંથી પોસ્ટનું શીર્ષક છુપાવો.','Hide Post Title'=>'પોસ્ટ શીર્ષક છુપાવો','Label used for 404 error item in breadcrumbs.'=>'બ્રેડક્રમ્સમાં 404 એરર આઇટમ માટે વપરાયેલ લેબલ.','404 label'=>'404 લેબલ','Format the label used for search results pages.'=>'શોધ પરિણામો પૃષ્ઠો માટે વપરાયેલ લેબલને ફોર્મેટ કરો.','Search Results Format'=>'શોધ પરિણામો ફોર્મેટ','Format the label used for archive pages.'=>'આર્કાઇવ પૃષ્ઠો માટે ઉપયોગમાં લેવાતા લેબલને ફોર્મેટ કરો.','Archive Format'=>'આર્કાઇવ ફોર્મેટ','Prefix for the breadcrumb path.'=>'બ્રેડક્રમ્બ પાથ માટે ઉપસર્ગ.','Prefix Breadcrumb'=>'ઉપસર્ગ બ્રેડક્રમ્બ','Label used for homepage link (first item) in breadcrumbs.'=>'બ્રેડક્રમ્સમાં હોમપેજ લિંક (પ્રથમ આઇટમ) માટે વપરાયેલ લેબલ.','Homepage label'=>'હોમપેજ લેબલ','Display homepage breadcrumb in trail.'=>'ટ્રેલમાં હોમપેજ બ્રેડક્રમ્બ પ્રદર્શિત કરો.','Show Homepage Link'=>'ટ્રેલમાં હોમપેજ બ્રેડક્રમ્બ પ્રદર્શિત કરો.','Separator character or string that appears between breadcrumb items.'=>'વિભાજક અક્ષર અથવા સ્ટ્રિંગ કે જે બ્રેડક્રમ્બ વસ્તુઓ વચ્ચે દેખાય છે.','Turning off breadcrumbs will hide breadcrumbs inserted in template files too.'=>'બ્રેડક્રમ્સને બંધ કરવાથી ટેમ્પલેટ ફાઇલોમાં દાખલ કરાયેલા બ્રેડક્રમ્સને પણ છુપાવવામાં આવશે.','Enable breadcrumbs function'=>'બ્રેડક્રમ્સ કાર્ય સક્ષમ કરો','Remove WooCommerce generator tag from the source code.'=>'સ્ત્રોત કોડમાંથી WooCommerce જનરેટર ટેગ દૂર કરો.','Remove Generator Tag'=>'જનરેટર ટેગ દૂર કરો','default: /product-category/accessories/action-figures/ - changed: /product-category/action-figures/'=>'ડિફોલ્ટ: /product-category/accessories/action-figures/ - બદલાયેલ: /product-category/action-figures/','Remove parent slugs from category URL.'=>'કૅટેગરી URL માંથી પિતૃ સ્લગ્સ દૂર કરો.',' Remove parent slugs'=>' પિતૃ સ્લગ્સ દૂર કરો','default: /product-category/accessories/action-figures/ - changed: /accessories/action-figures/'=>'ડિફોલ્ટ: /product-category/accessories/action-figures/ - બદલાયેલ: /accessories/action-figures/','Remove prefix from category URL.'=>'શ્રેણી URL માંથી ઉપસર્ગ દૂર કરો.','Remove category base'=>'શ્રેણી આધાર દૂર કરો','Remove base'=>'આધાર દૂર કરો','Product\'s brand of the current product'=>'વર્તમાન ઉત્પાદનની પ્રોડક્ટની બ્રાન્ડ','Product\'s brand.'=>'ઉત્પાદનની બ્રાન્ડ.','Product\'s short description of the current product'=>'વર્તમાન ઉત્પાદનનું ઉત્પાદન ટૂંકું વર્ણન','Product\'s short description.'=>'ઉત્પાદનનું ટૂંકું વર્ણન.','Product\'s SKU of the current product'=>'વર્તમાન ઉત્પાદનનું ઉત્પાદનનું SKU','Product\'s SKU.'=>'પ્રોડક્ટનું SKU.','Product\'s price of the current product'=>'વર્તમાન ઉત્પાદનની ઉત્પાદન કિંમત','Product\'s price.'=>'ઉત્પાદનની કિંમત.','Include archive pages of terms that have no posts associated.'=>'શબ્દોના આર્કાઇવ પૃષ્ઠો શામેલ કરો કે જેમાં કોઈ પોસ્ટ સંકળાયેલી નથી.','Include Empty Terms'=>'ખાલી શરતો શામેલ કરો','Include archive pages for terms of this taxonomy in the XML sitemap.'=>'XML સાઇટમેપમાં આ વર્ગીકરણની શરતો માટે આર્કાઇવ પૃષ્ઠો શામેલ કરો.','Insert custom field (post meta) names which contain image URLs to include them in the sitemaps. Add one per line.'=>'કસ્ટમ ફીલ્ડ (પોસ્ટ મેટા) નામો દાખલ કરો જેમાં તેમને સાઇટમેપ્સમાં શામેલ કરવા માટે છબી URL હોય. લીટી દીઠ એક ઉમેરો.','Image Custom Fields'=>'છબી કસ્ટમ ફીલ્ડ્સ','Include this post type in the XML sitemap.'=>'XML સાઇટમેપમાં આ પોસ્ટ પ્રકારનો સમાવેશ કરો.','Include in Sitemap'=>'સાઇટમેપમાં શામેલ કરો','Add term IDs, separated by comma. This option is applied for all taxonomies.'=>'અલ્પવિરામથી અલગ કરીને, શબ્દ ID ઉમેરો. આ વિકલ્પ બધા વર્ગીકરણો માટે લાગુ પડે છે.','Exclude Terms'=>'શરતો બાકાત રાખો','Enter post IDs of posts you want to exclude from the sitemap, separated by commas. This option **applies** to all posts types including posts, pages, and custom post types.'=>'સાઇટમેપમાંથી તમે જે પોસ્ટ્સને બાકાત રાખવા માંગો છો તેના પોસ્ટ ID અલ્પવિરામથી અલગ કરીને દાખલ કરો. આ વિકલ્પ પોસ્ટ્સ, પૃષ્ઠો અને કસ્ટમ પોસ્ટ પ્રકારો સહિત તમામ પોસ્ટ પ્રકારોને **લાગુ પડે છે**.','Exclude Posts'=>'પોસ્ટ્સ બાકાત રાખો','Include the Featured Image too, even if it does not appear directly in the post content.'=>'ફીચર્ડ છબી પણ શામેલ કરો, ભલે તે પોસ્ટ સામગ્રીમાં સીધી દેખાતી ન હોય.','Include Featured Images'=>'ફીચર્ડ છબીઓ શામેલ કરો','Include reference to images from the post content in sitemaps. This helps search engines index the important images on your pages.'=>'સાઇટમેપ્સમાં પોસ્ટ સામગ્રીમાંથી છબીઓનો સંદર્ભ શામેલ કરો. આ સર્ચ એન્જિનને તમારા પૃષ્ઠો પરની મહત્વપૂર્ણ છબીઓને ઇન્ડેક્સ કરવામાં મદદ કરે છે.','Images in Sitemaps'=>'સાઇટમેપ્સમાં છબીઓ','Max number of links on each sitemap page.'=>'દરેક સાઇટમેપ પેજ પર લિંક્સની મહત્તમ સંખ્યા.','Links Per Sitemap'=>'સાઇટમેપ દીઠ લિંક્સ','Add user IDs, separated by commas, to exclude them from the sitemap.'=>'સાઇટમેપમાંથી બાકાત રાખવા માટે, અલ્પવિરામથી અલગ કરીને વપરાશકર્તા ID ઉમેરો.','Exclude Users'=>'વપરાશકર્તાઓને બાકાત રાખો','Exclude User Roles'=>'વપરાશકર્તા ભૂમિકાઓ બાકાત','XML Sitemap %1$s %2$s'=>'XML સાઇટમેપ %1$s %2$s','Rank Math has detected new post types: %1$s. You may want to check the settings of the <a href="%2$s">Titles &amp; Meta page</a> and <a href="%3$s">the Sitemap</a>.'=>'રેન્ક મેથને નવા પોસ્ટ પ્રકારો મળ્યા છે: %1$s. તમે <a href="%2$s">શીર્ષકો &amp; મેટા પૃષ્ઠ</a> ​​અને <a href="%3$s">સાઇટમેપ</a>.','%s archives'=>'%s આર્કાઇવ્સ','your product %s pages'=>'તમારું ઉત્પાદન %s પૃષ્ઠો','Taxonomies:'=>'વર્ગીકરણ:','Please note that this will add the attachment page URLs to the sitemap, not direct image URLs.'=>'મહેરબાની કરીને નોંધ કરો કે આ સાઇટમેપમાં જોડાણ પૃષ્ઠ URL ઉમેરશે, સીધી છબી URL નહીં.','Sitemap URL: %s'=>'સાઇટમેપ URL: %s','single %s'=>'સિંગલ %s','your product pages'=>'તમારા ઉત્પાદન પૃષ્ઠો','attachments'=>'જોડાણો','Set the sitemap options for author archive pages. %s.'=>'લેખક આર્કાઇવ પૃષ્ઠો માટે સાઇટમેપ વિકલ્પો સેટ કરો. %s','This tab contains General settings related to the XML sitemaps.'=>'આ ટૅબમાં XML સાઇટમેપ્સ સંબંધિત સામાન્ય સેટિંગ્સ છે.','No sitemaps found.'=>'કોઈ સાઇટમેપ મળ્યાં નથી.','Your site has one or more sitemaps.'=>'તમારી સાઇટમાં એક અથવા વધુ સાઇટમેપ છે.','+%d More...'=>'+%d વધુ...','There are %s published posts where the primary focus keyword does not appear in the post title.'=>'ત્યાં %s પ્રકાશિત પોસ્ટ્સ છે જ્યાં પ્રાથમિક ફોકસ કીવર્ડ પોસ્ટ શીર્ષકમાં દેખાતો નથી.','Focus keywords appear in the titles of published posts where it is set.'=>'ફોકસ કીવર્ડ્સ પ્રકાશિત પોસ્ટના શીર્ષકોમાં દેખાય છે જ્યાં તે સેટ છે.','There are %s with no focus keyword set.'=>'ફોકસ કીવર્ડ સેટ વગરના %s છે.','All published posts have focus keywords set.'=>'બધી પ્રકાશિત પોસ્ટ્સમાં ફોકસ કીવર્ડ સેટ છે.','You have not linked Google Search Console yet.'=>'તમે હજી સુધી Google શોધ કન્સોલને લિંક કર્યું નથી.','Google Search Console has been linked.'=>'Google શોધ કન્સોલ લિંક કરવામાં આવ્યું છે.','Post permalink structure is set to %s.'=>'પોસ્ટ પરમાલિંક માળખું %s પર સેટ છે.','Permalinks are set to a custom structure but the post titles do not appear in the permalinks.'=>'પરમાલિંક્સ કસ્ટમ સ્ટ્રક્ચર પર સેટ છે પરંતુ પોસ્ટ ટાઇટલ પરમાલિંક્સમાં દેખાતા નથી.','Permalinks are set to the default value. <em>Pretty permalinks</em> are disabled. '=>'પરમાલિંક્સ ડિફૉલ્ટ મૂલ્ય પર સેટ છે. <em>સુંદર પરમાલિંક્સ</em> અક્ષમ છે. ','Your Site Tagline is set to a custom value.'=>'તમારી સાઇટ ટેગલાઇન કસ્ટમ મૂલ્ય પર સેટ છે.','Your Site Tagline is set to the default value <em>Just another WordPress site</em>.'=>'તમારી સાઇટ ટેગલાઇન ડિફોલ્ટ મૂલ્ય <em>માત્ર બીજી WordPress સાઇટ</em> પર સેટ છે.','If you don\'t have an XML sitemap, the best option is to install a plugin that creates sitemaps for you. That way you\'ll know the sitemap will always be up-to-date. Plugins can also automatically ping the search engines when the XML file is updated. The Rank Math WordPress plugin gives you complete control over your site\'s XML sitemaps. You can control the settings for each page as you write or edit it, and Rank Math will ping Google as soon as you submit your edits. This results in fast crawls and indexing.'=>'જો તમારી પાસે XML સાઇટમેપ ન હોય, તો શ્રેષ્ઠ વિકલ્પ એ પ્લગઇન ઇન્સ્ટોલ કરવાનો છે જે તમારા માટે સાઇટમેપ બનાવે છે. આ રીતે તમે જાણશો કે સાઇટમેપ હંમેશા અપ-ટૂ-ડેટ રહેશે. XML ફાઇલ અપડેટ થાય ત્યારે પ્લગઇન્સ આપમેળે સર્ચ એન્જિનને પિંગ પણ કરી શકે છે. રેન્ક મેથ વર્ડપ્રેસ પ્લગઇન તમને તમારી સાઇટના XML સાઇટમેપ્સ પર સંપૂર્ણ નિયંત્રણ આપે છે. તમે દરેક પૃષ્ઠની સેટિંગ્સને તમે લખો છો અથવા સંપાદિત કરો છો તેને નિયંત્રિત કરી શકો છો, અને તમે તમારા સંપાદનો સબમિટ કરો કે તરત જ રેન્ક મેથ Googleને પિંગ કરશે. આ ઝડપી ક્રોલ અને ઇન્ડેક્સીંગમાં પરિણમે છે.','XML sitemaps are a special type of text file that tells search engines about the structure of your site. They\'re a list of all the resources (pages and files) you would like the search engine to index. You can assign different priorities, so certain pages will be crawled first. Before XML sitemaps, search engines were limited to indexing the content they could find by following links. That\'s still an important feature for search engine spiders, but XML sitemaps have made it easier for content creators and search engines to collaborate.'=>'XML સાઇટમેપ્સ એ એક વિશિષ્ટ પ્રકારની ટેક્સ્ટ ફાઇલ છે જે તમારી સાઇટની રચના વિશે શોધ એન્જિનને જણાવે છે. તે બધા સંસાધનો (પૃષ્ઠો અને ફાઇલો) ની સૂચિ છે જે તમે શોધ એન્જિનને અનુક્રમિત કરવા માંગો છો. તમે વિવિધ પ્રાથમિકતાઓ સોંપી શકો છો, તેથી ચોક્કસ પૃષ્ઠો પ્રથમ ક્રોલ કરવામાં આવશે. XML સાઇટમેપ્સ પહેલાં, શોધ એંજીન લિંક્સને અનુસરીને તેઓ શોધી શકે તે સામગ્રીને અનુક્રમિત કરવા માટે મર્યાદિત હતા. તે હજી પણ સર્ચ એન્જિન સ્પાઈડર માટે એક મહત્વપૂર્ણ લક્ષણ છે, પરંતુ XML સાઇટમેપ્સે સામગ્રી સર્જકો અને શોધ એન્જિન માટે સહયોગ કરવાનું સરળ બનાવ્યું છે.','Read <a href="%1$s" target="_blank">this article</a> for detailed instructions on setting up your Google Webmaster account and getting Rank Math to work with the Google Search Console.'=>'તમારા Google વેબમાસ્ટર એકાઉન્ટને સેટ કરવા અને Google શોધ કન્સોલ સાથે કામ કરવા માટે રેન્ક મેથ મેળવવા વિશે વિગતવાર સૂચનાઓ માટે <a href="%1$s" target="_blank">આ લેખ</a> વાંચો.','You can integrate the Google Search Console with Rank math in the <a href="%1$s" target="_blank">Search Console tab</a>. of Rank Math\'s General Settings menu.'=>'તમે <a href="%1$s" target="_blank">Search Console ટૅબ</a>માં Google Search Console ને રેન્ક ગણિત સાથે એકીકૃત કરી શકો છો. રેન્ક મેથના સામાન્ય સેટિંગ્સ મેનૂમાંથી.','Google\'s Search Console is a vital source of information concerning your rankings and click-through rates.  Rank Math can import this data, so you don\'t have to log into your Google account to get the data you need.'=>'Google નું સર્ચ કન્સોલ એ તમારી રેન્કિંગ અને ક્લિક-થ્રુ રેટ સંબંધિત માહિતીનો મહત્વપૂર્ણ સ્ત્રોત છે. રેન્ક મેથ આ ડેટાને આયાત કરી શકે છે, જેથી તમને જરૂરી ડેટા મેળવવા માટે તમારે તમારા Google એકાઉન્ટમાં લૉગ ઇન કરવાની જરૂર નથી.','Register at Google Search Console and verificate your site by adding the code to <a href="%1$s">Settings &gt; Verificate Tools</a>, then navigate to <a href="%2$s">Settings &gt; Search Console</a> to authenticate and link your site.'=>'Google શોધ કન્સોલ પર નોંધણી કરો અને <a href="%1$s">સેટિંગ્સ &gt;માં કોડ ઉમેરીને તમારી સાઇટને ચકાસો. ટૂલ્સ ચકાસો</a>, પછી <a href="%2$s">સેટિંગ્સ &gt; પર નેવિગેટ કરો. તમારી સાઇટને પ્રમાણિત કરવા અને લિંક કરવા માટે શોધ કન્સોલ</a>.','Fixing the issue is simple - just edit the post/page and add the focus keyword(s) to the title.'=>'સમસ્યાને ઠીક કરવી સરળ છે - ફક્ત પોસ્ટ/પૃષ્ઠને સંપાદિત કરો અને શીર્ષકમાં ફોકસ કીવર્ડ(ઓ) ઉમેરો.','HTML Page Titles play a large role in Google\'s ranking algorithm.  When you add a Focus Keyword to a post or page, Rank Math will check to see that you used the keyword in the title.  If it finds any posts or pages that are missing the keyword in the title, it will tell you here.'=>'HTML પૃષ્ઠ શીર્ષકો Google ના રેન્કિંગ અલ્ગોરિધમમાં મોટી ભૂમિકા ભજવે છે. જ્યારે તમે પોસ્ટ અથવા પૃષ્ઠ પર ફોકસ કીવર્ડ ઉમેરો છો, ત્યારે રેન્ક મેથ એ જોવા માટે તપાસ કરશે કે તમે શીર્ષકમાં કીવર્ડનો ઉપયોગ કર્યો છે. જો તેને એવી કોઈ પોસ્ટ અથવા પેજ મળે કે જેમાં શીર્ષકમાં કીવર્ડ ખૂટે છે, તો તે તમને અહીં જણાવશે.','Make sure the focus keywords you set for the posts appear in their titles.'=>'ખાતરી કરો કે તમે પોસ્ટ્સ માટે સેટ કરેલા ફોકસ કીવર્ડ્સ તેમના શીર્ષકોમાં દેખાય છે.','Post Titles Missing Focus Keywords'=>'પોસ્ટ શીર્ષકો ફોકસ કીવર્ડ્સ ખૂટે છે','Fixing this issue is easy - just edit the post, and set a Focus Keyword.  Then follow Rank Math\'s analysis to improve your rankings.'=>'આ સમસ્યાને ઠીક કરવી સરળ છે - ફક્ત પોસ્ટને સંપાદિત કરો, અને ફોકસ કીવર્ડ સેટ કરો. પછી તમારી રેન્કિંગ સુધારવા માટે રેન્ક મેથના વિશ્લેષણને અનુસરો.','Of course, if you don\'t give Rank Math a focus keyword to work with, it can\'t give you any useful feedback.'=>'અલબત્ત, જો તમે રેન્ક મેથને કામ કરવા માટે ફોકસ કીવર્ડ ન આપો, તો તે તમને કોઈ ઉપયોગી પ્રતિસાદ આપી શકશે નહીં.','Rank Math uses these focus keywords to analyze your on-page content.  It can tell if you\'ve done a good job of optimizing your text to rank for these keywords.'=>'રેન્ક મેથ તમારી ઑન-પેજ સામગ્રીનું વિશ્લેષણ કરવા માટે આ ફોકસ કીવર્ડ્સનો ઉપયોગ કરે છે. આ કીવર્ડ્સ માટે રેન્ક આપવા માટે તમે તમારા ટેક્સ્ટને ઑપ્ટિમાઇઝ કરવાનું સારું કામ કર્યું છે કે કેમ તે તે કહી શકે છે.','Rank Math allows you to set a focus keyword for every post and page you write - the option is in the "Meta Box", which appears under the text editor in the screen where you write and edit content.'=>'રેન્ક મેથ તમને તમે લખો છો તે દરેક પોસ્ટ અને પૃષ્ઠ માટે ફોકસ કીવર્ડ સેટ કરવાની મંજૂરી આપે છે - વિકલ્પ "મેટા બોક્સ" માં છે, જે સ્ક્રીનમાં ટેક્સ્ટ એડિટર હેઠળ દેખાય છે જ્યાં તમે સામગ્રી લખો છો અને સંપાદિત કરો છો.','Setting focus keywords for your posts allows Rank Math to analyse the content.'=>'તમારી પોસ્ટ્સ માટે ફોકસ કીવર્ડ્સ સેટ કરવાથી રેન્ક મેથને સામગ્રીનું વિશ્લેષણ કરવાની મંજૂરી મળે છે.','Focus Keywords'=>'ફોકસ કીવર્ડ્સ','This looks nice for readers - and it gets your keywords into the URL (keywords in the URL is a ranking factor).'=>'આ વાચકો માટે સરસ લાગે છે - અને તે તમારા કીવર્ડ્સને URL માં મેળવે છે (URL માં કીવર્ડ્સ રેન્કિંગ પરિબળ છે).','This option will replace the "?p=99" part of the URL with the post\'s title, like this: http://www.yoursite.com/my-amazing-post-title/'=>'આ વિકલ્પ URL ના "?p=99" ભાગને પોસ્ટના શીર્ષક સાથે બદલશે, જેમ કે: http://www.yoursite.com/my-amazing-post-title/','Fortunately, it\'s very easy to fix.  Just hop on over to <a target="_blank" href="%1$s">Settings - Permalinks</a>.  Then chose the "Post Name" option.'=>'સદનસીબે, તેને ઠીક કરવું ખૂબ જ સરળ છે.  બસ <a target="_blank" href="%1$s">સેટિંગ્સ - પરમાલિંક્સ</a> પર જાઓ.  પછી “પોસ્ટ નેમ” વિકલ્પ પસંદ કરો.','It\'s not very kind on the eyes, and it does nothing for your site\'s SEO.  In fact, it can hurt it - Google\'s bot is quite cautious about crawling pages that look auto-generated.'=>'તે નજરે બહુ દયાળુ નથી, અને તે તમારી સાઇટના SEO માટે કંઈ કરતું નથી.  હકીકતમાં, તે નુકસાન પહોંચાડી શકે છે - ગુગલનો બોટ ઓટો-જનરેટેડ દેખાતા પેજને ક્રોલ કરવા અંગે ખૂબ સાવધ છે.','The standard permalink structure is pretty ugly - WordPress generates offputting URLs like: http://www.yoursite.com/?p=99'=>'સ્ટાન્ડર્ડ પરમાલિંક સ્ટ્રક્ચર ખૂબ જ ખરાબ છે - વર્ડપ્રેસ ઑફપુટિંગ URL જનરેટ કરે છે જેમ કે: http://www.yoursite.com/?p=99','For the best SEO results, use a custom permalink structure, preferably one that includes the post title (<code>%%postname%%</code>). You can change it by navigating to <a href="%s">Settings &gt; Permalinks</a>'=>'શ્રેષ્ઠ SEO પરિણામો માટે, કસ્ટમ પરમાલિંક સ્ટ્રક્ચરનો ઉપયોગ કરો, પ્રાધાન્યમાં એવું જેમાં પોસ્ટ શીર્ષક (<code>%%postname%%</code>) શામેલ હોય. તમે તેને <a href="%s">સેટિંગ્સ &gt; પર નેવિગેટ કરીને બદલી શકો છો. કાયમી લિંક્સ</a>','Permalink Structure'=>'કાયમી લિંક માળખું','The tagline is the second option.  Choose a tagline that summarizes your site in a few words.  The tagline is also a good place to use your main keyword.'=>'ટેગલાઇન બીજો વિકલ્પ છે.  તમારી સાઇટનો સારાંશ થોડા શબ્દોમાં આપતી ટેગલાઇન પસંદ કરો.  તમારા મુખ્ય કીવર્ડનો ઉપયોગ કરવા માટે ટેગલાઇન પણ એક સારી જગ્યા છે.','Changing your tagline is very easy.  Just head on over to <a target="_blank" href="%1$s">Settings - General</a> in WordPress\'s admin menu (on the left), or click on the link in this sentence.'=>'તમારો ટૅગલાઇન બદલવી ખૂબ જ સરળ છે.  WordPress ના એડમિન મેનૂ (ડાબી બાજુ) માં <a target="_blank" href="%1$s"> સેટિંગ્સ - જનરલ</a> પર જાઓ, અથવા આ વાક્યમાં આપેલ લિંક પર ક્લિક કરો.','Unfortunately, the standard WordPress tagline is "Just Another WordPress site."  That\'s pretty sloppy looking, and it does nothing for your SEO.  In fact, it\'s actually a security risk - it makes it easy for hackers with a WordPress exploit to locate your site with an automated search.'=>'કમનસીબે, પ્રમાણભૂત WordPress ટેગલાઇન "જસ્ટ અનધર WordPress સાઇટ" છે.  તે દેખાવમાં ખૂબ જ ખરાબ છે, અને તે તમારા SEO માટે કંઈ કરતું નથી.  વાસ્તવમાં, તે ખરેખર એક સુરક્ષા જોખમ છે - તે WordPress એક્સપ્લોઈટ ધરાવતા હેકર્સ માટે ઓટોમેટેડ શોધ દ્વારા તમારી સાઇટ શોધવાનું સરળ બનાવે છે.','Most WordPress themes place your site\'s tagline in a prominent position (inside header tags near the top of the page).  Using the right tagline can give your site an SEO boost.'=>'મોટાભાગની WordPress થીમ્સ તમારી સાઇટની ટેગલાઇનને એક અગ્રણી સ્થાને (પૃષ્ઠની ટોચની નજીક હેડર ટેગ્સની અંદર) મૂકે છે.  યોગ્ય ટેગલાઇનનો ઉપયોગ તમારી સાઇટને SEO બુસ્ટ આપી શકે છે.','Your theme may display the Site Tagline, and it can also be used in SEO titles &amp; descriptions. Set it to something unique. You can change it by navigating to <a href="%s">Settings &gt; General</a>.'=>'તમારી થીમ સાઇટ ટેગલાઇન પ્રદર્શિત કરી શકે છે, અને તેનો ઉપયોગ SEO ટાઇટલ અને લાઇબ્રેરીમાં પણ થઈ શકે છે. વર્ણનો. તેને કંઈક અનોખા પર સેટ કરો. તમે તેને <a href="%s">સેટિંગ્સ &gt; પર નેવિગેટ કરીને બદલી શકો છો. સામાન્ય</a>.','Site Tagline'=>'સાઇટ ટૅગલાઇન','OK'=>'ઠીક છે','SEO Score'=>'SEO સ્કોર','SEO Analysis for this page'=>'આ પૃષ્ઠ માટે SEO વિશ્લેષણ','Analyze this Page'=>'આ પૃષ્ઠનું વિશ્લેષણ કરો','Site-wide analysis'=>'સાઇટ-વ્યાપી વિશ્લેષણ','Size: %s'=>'કદ: %s','Data Rows: %s'=>'ડેટા પંક્તિઓ: %s','Fetching in Progress'=>'આનયન પ્રગતિમાં છે','Update data manually'=>'મેન્યુઅલી ડેટા અપડેટ કરો','Items'=>'વસ્તુઓ','Google oAuth is not authorized.'=>'Google oAuth અધિકૃત નથી.','Not a valid settings founds to delete cache.'=>'કેશ કાઢી નાખવા માટે માન્ય સેટિંગ્સ નથી.','Average Position'=>'સરેરાશ સ્થિતિ','Total Impressions'=>'કુલ છાપ','Total Clicks'=>'કુલ ક્લિક્સ','Total Keywords'=>'કુલ કીવર્ડ્સ','Not found'=>'મળી નથી','Response Code'=>'પ્રતિભાવ કોડ','Bad request. Please check the code.'=>'ખરાબ વિનંતી. કૃપા કરીને કોડ તપાસો.','Pages'=>'પૃષ્ઠો','Analytics'=>'ઍનલિટિક્સ','You are not authorized to perform this action.'=>'તમે આ ક્રિયા કરવા માટે અધિકૃત નથી','Service Type'=>'સેવાનો પ્રકાર','Application Category'=>'એપ્લિકેશન શ્રેણી','Operating System'=>'ઓપરેટિંગ સિસ્ટમ','Price Currency'=>'કિંમત ચલણ','Gender'=>'લિંગ','Duration'=>'સમયગાળો','Menu URL'=>'મેનુ URL','Serves Cuisine'=>'ભોજન પીરસે છે','Recipe Instructions'=>'રેસીપી સૂચનાઓ','Recipe Ingredients'=>'રેસીપી ઘટકો','Recipe Video Description'=>'રેસીપી વિડિઓ વર્ણન','Recipe Video Name'=>'રેસીપી વિડિઓ નામ','Recipe Video Thumbnail'=>'રેસીપી વિડિઓ થંબનેલ','Total Time'=>'કુલ સમય','Cooking Time'=>'રસોઈનો સમય','Preparation Time'=>'તૈયારી સમય','Recipe Yield'=>'રેસીપી ઉપજ','Keywords'=>'કીવર્ડ્સ','Cuisine'=>'ભોજન','Product In-Stock'=>'સ્ટોકમાં ઉત્પાદન','Product Price'=>'ઉત્પાદન કિંમત','Product Currency'=>'ઉત્પાદન ચલણ','Product Brand'=>'ઉત્પાદન બ્રાન્ડ','Product SKU'=>'ઉત્પાદન SKU','Closing Time'=>'બંધ થવાનો સમય','Opening Time'=>'ખુલવાનો સમય','Unpublish when expired'=>'સમયસીમા સમાપ્ત થાય ત્યારે અપ્રકાશિત કરો','Expiry Posted'=>'સમાપ્તિ પોસ્ટ','Date Posted'=>'તારીખ પોસ્ટ','Salary Currency'=>'પગાર ચલણ','Stock Inventory'=>'સ્ટોક ઈન્વેન્ટરી','Availability Starts'=>'ઉપલબ્ધતા શરૂ થાય છે','Availability'=>'ઉપલબ્ધતા','Currency'=>'ચલણ','Entry Price'=>'પ્રવેશ કિંમત','Ticket URL'=>'ટિકિટ URL','End Date'=>'સમાપ્તિ તારીખ','Start Date'=>'પ્રારંભ તારીખ','Event Status'=>'ઘટના સ્થિતિ','Venue URL'=>'સ્થળ URL','Venue Name'=>'સ્થળનું નામ','Event Type'=>'ઇવેન્ટનો પ્રકાર','Course Provider URL'=>'કોર્સ પ્રદાતા URL','Course Provider'=>'કોર્સ પ્રદાતા','ISBN'=>'ISBN','Edition'=>'આવૃત્તિ','Author'=>'લેખક','Url'=>'યુઆરએલ','Headline'=>'હેડલાઇન','Extend the functionality of WordPress by creating redirects in our plugin when you change the slug of a post, page, category or a CPT. You can modify the redirection further according to your needs.'=>'જ્યારે તમે પોસ્ટ, પેજ, કેટેગરી અથવા સીપીટીનો સ્લગ બદલો ત્યારે અમારા પ્લગઇનમાં રીડાયરેક્ટ બનાવીને વર્ડપ્રેસની કાર્યક્ષમતાને વિસ્તૃત કરો. તમે તમારી જરૂરિયાતો અનુસાર રીડાયરેક્શનને વધુ સંશોધિત કરી શકો છો.','Auto Post Redirect'=>'ઓટો પોસ્ટ રીડાયરેક્ટ','Custom Url '=>'કસ્ટમ Url ','Custom Redirection'=>'કસ્ટમ રીડાયરેક્શન','Redirect to Homepage'=>'હોમપેજ પર રીડાયરેક્ટ કરો','Default 404'=>'ડિફોલ્ટ 404','Fallback Behavior'=>'ડિફોલ્ટ 404','Display the Debug Console instead of being redirected. Administrators only.'=>'રીડાયરેક્ટ થવાને બદલે ડીબગ કન્સોલ પ્રદર્શિત કરો. સંચાલકો જ.','Debug Redirections'=>'ડીબગ રીડાયરેક્શન','Export to Nginx config file'=>'Nginx રૂપરેખા ફાઇલમાં નિકાસ કરો','Export to .htaccess'=>'.htaccess પર નિકાસ કરો','Add New'=>'નવું ઉમેરો','Redirections can be exported to your .htaccess file for faster redirections, in SEO > Settings > Import/Export.'=>'એસઇઓ > સેટિંગ્સ > આયાત/નિકાસમાં, ઝડપી પુનઃનિર્દેશો માટે તમારી .htaccess ફાઇલમાં રીડાયરેશન નિકાસ કરી શકાય છે.','Using a 302 <em>temporary</em> redirection is useful when you want to test a new page for client feedback temporarily without affecting the SEO scores of the original page.'=>'302 <em>અસ્થાયી</em> રીડાયરેક્શનનો ઉપયોગ કરવો ઉપયોગી છે જ્યારે તમે મૂળ પૃષ્ઠના SEO સ્કોરને અસર કર્યા વિના અસ્થાયી રૂપે ક્લાયંટ પ્રતિસાદ માટે નવા પૃષ્ઠનું પરીક્ષણ કરવા માંગતા હો.','301 redirections are <em>permanent</em>. The old URL will be removed in search engines and replaced by the new one, passing on SearchRank and other SEO scores. Browsers may also store the new URL in cache and redirect to it even after the redirection is deleted from the list here.'=>'301 રીડાયરેકશન <em>કાયમી</em> છે. સર્ચ રેન્ક અને અન્ય SEO સ્કોર્સ પર પસાર થતાં સર્ચ એન્જિનમાં જૂના URL ને દૂર કરવામાં આવશે અને નવા દ્વારા બદલવામાં આવશે. બ્રાઉઝર્સ નવા URL ને કેશમાં સંગ્રહિત કરી શકે છે અને પુનઃદિશામાનને અહીંની સૂચિમાંથી કાઢી નાખ્યા પછી પણ તેના પર રીડાયરેક્ટ કરી શકે છે.','Here you can set up custom redirections. It is important to choose the right type of redirection.'=>'અહીં તમે કસ્ટમ રીડાયરેક્શન સેટ કરી શકો છો. યોગ્ય પ્રકારનું રીડાયરેક્શન પસંદ કરવું મહત્વપૂર્ણ છે.','You can also activate, deactivate, or delete multiple items at once using the Bulk Actions dropdown.'=>'તમે જથ્થાબંધ ક્રિયાઓના ડ્રોપડાઉનનો ઉપયોગ કરીને એક સાથે અનેક આઇટમને સક્રિય, નિષ્ક્રિય અથવા કાઢી નાખી શકો છો.','<strong>Delete</strong> permanently removes the redirection.'=>'<strong>કાઢી નાખો</strong> પુનઃદિશામાનને કાયમ માટે દૂર કરે છે.','<strong>Activate/Deactivate</strong> redirections. Deactivated redirections do not take effect on your site.'=>'પુનઃનિર્દેશકોને <strong>સક્રિય/નિષ્ક્રિય કરો</strong>. નિષ્ક્રિય કરેલ રીડાયરેકશન તમારી સાઇટ પર અસર કરતા નથી.','<strong>Edit</strong> redirection details: from/to URLs and the redirection type.'=>'પુનઃનિર્દેશનની વિગતો <strong>સંપાદિત કરો</strong>: URLs અને રીડાયરેક્શન પ્રકાર.','<strong>Note:</strong> This interstitial page is displayed only to administrators. Site visitors are redirected without delay.'=>'<strong>નોંધ:</strong> આ ઇન્ટર્સ્ટિશિયલ પૃષ્ઠ ફક્ત સંચાલકોને જ પ્રદર્શિત થાય છે. સાઇટ મુલાકાતીઓને વિલંબ કર્યા વિના રીડાયરેક્ટ કરવામાં આવે છે.','Manage All Redirections'=>'બધા રીડાયરેક્ટ્સને મેનેજ કરો','Manage This Redirection'=>'આ રીડાયરેક્શન મેનેજ કરો','Continue redirecting'=>'રીડાયરેક્ટ કરવાનું ચાલુ રાખો','Stop Redirection'=>'રીડાયરેક્શન રોકો','Redirecting in %s seconds...'=>'%s સેકન્ડમાં રીડાયરેક્ટ કરી રહ્યું છે...',' To '=>' પ્રતિ ','Redirecting from '=>'રીડાયરેક્ટ કરી રહ્યું છે ','Redirection Debugger'=>'ડીબગર રીડાયરેક્શન','<strong>SEO Notice:</strong> A previously published %1$s has been moved to trash. You may redirect <code>%2$s</code> to <a href="%3$s">a new url</a>.'=>'<strong>SEO સૂચના:</strong> અગાઉ પ્રકાશિત થયેલ %1$s ને કચરાપેટીમાં ખસેડવામાં આવ્યું છે. તમે <code>%2$s</code> ને <a href="%3$s">નવા url</a> પર રીડાયરેક્ટ કરી શકો છો.','SEO Notice: you just changed the slug of a %1$s and Rank Math has automatically created a redirection. You can edit the redirection by <a href="%2$s">clicking here</a>.'=>'SEO સૂચના: તમે હમણાં જ %1$s નું સ્લગ બદલ્યું છે અને રેન્ક મેથે આપમેળે રીડાયરેક્શન બનાવ્યું છે. તમે <a href="%2$s">અહીં ક્લિક કરીને</a> રીડાયરેક્શનને સંપાદિત કરી શકો છો.','Empty Trash'=>'કચરાપેટી ખાલી કરો','All'=>'બધા','Move to Trash'=>'ટ્રેશમાં ખસેડો','Last Accessed'=>'છેલ્લે ઍક્સેસ કરેલ','Type'=>'પ્રકાર','To'=>'થી','From'