rt all Schema data for Posts, Pages, and custom post types.'=>'પોસ્ટ્સ, પેજીસ અને કસ્ટમ પોસ્ટ પ્રકારો માટેનો તમામ સ્કીમા ડેટા આયાત કરો.','There are no redirection to import.'=>'આયાત કરવા માટે કોઈ રીડાયરેક્શન નથી.','User meta import failed.'=>'વપરાશકર્તા મેટા આયાત નિષ્ફળ.','Term meta import failed.'=>'ટર્મ મેટા આયાત નિષ્ફળ.','Posts meta import failed.'=>'પોસ્ટ્સ મેટા આયાત નિષ્ફળ ગઈ.','Settings import failed.'=>'સેટિંગ્સ આયાત નિષ્ફળ.','Imported %s redirections.'=>'આયાત કરેલ %s રીડાયરેક્ટ્સ.','Imported user meta for users %1$s - %2$s out of %3$s '=>'%3$s માંથી %1$s - %2$s વપરાશકર્તાઓ માટે આયાત કરેલ વપરાશકર્તા મેટા ','Imported term meta for %s terms.'=>'%s ટર્મ્સ માટે આયાત કરેલ ટર્મ મેટા.','Imported post meta for posts %1$s - %2$s out of %3$s '=>'%1$s પોસ્ટ્સ માટે આયાત કરેલ પોસ્ટ મેટા - %3$s માંથી %2$s ','Plugin deactivated successfully.'=>'પ્લગઇન સફળતાપૂર્વક નિષ્ક્રિય કરવામાં આવ્યું.','Settings imported successfully.'=>'સેટિંગ્સ સફળતાપૂર્વક આયાત કરવામાં આવી.','Unable to perform action this time.'=>'આ વખતે ક્રિયા કરી શકાતી નથી.','Import Redirections'=>'આયાત રીડાયરેક્શન્સ','Import meta information like titles, descriptions, focus keyword, robots meta, etc., of your author archive pages.'=>'તમારા લેખક આર્કાઇવ પૃષ્ઠોમાંથી શીર્ષકો, વર્ણનો, ફોકસ કીવર્ડ, રોબોટ્સ મેટા વગેરે જેવી મેટા માહિતી આયાત કરો.','Import Author Meta'=>'લેખક મેટા આયાત કરો','Import data like category, tag, and CPT meta data from SEO.'=>'SEO માંથી કેટેગરી, ટેગ અને CPT મેટા ડેટા જેવા ડેટા આયાત કરો.','Import Term Meta'=>'આયાત ટર્મ મેટા','Import meta information of your posts/pages like the focus keyword, titles, descriptions, robots meta, OpenGraph info, etc.'=>'તમારી પોસ્ટ્સ/પૃષ્ઠોની મેટા માહિતી આયાત કરો જેમ કે ફોકસ કીવર્ડ, શીર્ષકો, વર્ણનો, રોબોટ્સ મેટા, ઓપનગ્રાફ માહિતી વગેરે.','Import Post Meta'=>'પોસ્ટ મેટા આયાત કરો','Import plugin settings, global meta, sitemap settings, etc.'=>'પ્લગઇન સેટિંગ્સ, વૈશ્વિક મેટા, સાઇટમેપ સેટિંગ્સ વગેરે આયાત કરો.','Import Settings'=>'આયાત સેટિંગ્સ','Advanced Options'=>'અદ્યતન વ