ંથી રીડાયરેક્શન મોડ્યુલ માટે ડિફોલ્ટ મૂલ્યો સેટ કરો.','Redirections'=>'રીડાયરેક્શન્સ','The 404 monitor will let you see if visitors or search engines bump into any <code>404 Not Found</code> error while browsing your site.'=>'404 મોનિટર તમને જોવા દેશે કે મુલાકાતીઓ કે સર્ચ એન્જિન તમારી સાઇટ બ્રાઉઝ કરતી વખતે કોઈ <code>404 Not Found</code> ભૂલનો સામનો કરે છે કે નહીં.','Set default values for the 404 error monitor here.'=>'અહીં 404 એરર મોનિટર માટે ડિફોલ્ટ મૂલ્યો સેટ કરો.','404 Monitor'=>'404 મોનિટર','Save and Continue'=>'સાચવો અને ચાલુ રાખો','Set capabilities here.'=>'અહીં ક્ષમતાઓ સેટ કરો.','Role Manager'=>'ભૂમિકા મેનેજર','Strip Category Base'=>'સ્ટ્રીપ કેટેગરી બેઝ','Automatically add a <code>target="_blank"</code> attribute to external links appearing in your posts, pages, and other post types. The attributes are applied when the content is displayed, which does not change the stored content.'=>'તમારી પોસ્ટ્સ, પૃષ્ઠો અને અન્ય પોસ્ટ પ્રકારોમાં દેખાતી બાહ્ય લિંક્સમાં આપમેળે <code>target="_blank"</code> વિશેષતા ઉમેરો. જ્યારે સામગ્રી પ્રદર્શિત થાય છે ત્યારે વિશેષતાઓ લાગુ કરવામાં આવે છે, જે સંગ્રહિત સામગ્રીને બદલતી નથી.','Open External Links in New Tab/Window'=>'નવી ટૅબ/વિન્ડોમાં બાહ્ય લિંક્સ ખોલો','Automatically add <code>rel="nofollow"</code> attribute for external links appearing in your posts, pages, and other post types. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'તમારી પોસ્ટ, પૃષ્ઠો અને અન્ય પોસ્ટ પ્રકારોમાં દેખાતી બાહ્ય લિંક્સ માટે <code>rel="nofollow"</code> એટ્રિબ્યુટ ઑટોમૅટિક રીતે ઉમેરો. જ્યારે સામગ્રી પ્રદર્શિત થાય છે ત્યારે વિશેષતા ગતિશીલ રીતે લાગુ થાય છે, અને સંગ્રહિત સામગ્રી બદલાતી નથી.','Nofollow External Links'=>'નોફોલો એક્સટર્નલ લિંક્સ','Automatically add <code>rel="nofollow"</code> attribute for links pointing to external image files. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'બાહ્ય છબી ફાઇલો તરફ નિર્દેશ કરતી લિંક્સ માટે આપમેળે <code>rel="nofollow"</code> વિશેષતા ઉમેરો. જ્યારે સામગ્રી પ્રદર્શિત થાય છે ત્યારે વિશેષતા ગતિશીલ રીતે લાગુ થાય છે, અને સંગ્રહિત સામગ્રી બદલાતી નથી.','Nofollow Image File Links'=>'Nofollow ઇમેજ ફાઇલ લિંક્સ','Setting empty archives to <code>noindex</code> is useful for avoiding indexation of thin content pages and dilution of page rank. As soon as a post is added, the page is updated to <code>index</code>.'=>'ખાલી આર્કાઇવ્સને <code>noindex</code> પર સેટ કરવું પાતળા સામગ્રી પૃષ્ઠોના અનુક્રમણિકાને ટાળવા અને પૃષ્ઠ ક્રમમાં ઘટાડો કરવા માટે ઉપયોગી છે. પોસ્ટ ઉમેરવાની સાથે જ પેજને <code>ઇન્ડેક્સ</code> પર અપડેટ કરવામાં આવે છે.','Noindex Empty Category and Tag Archives'=>'નોઈન્ડેક્સ ખાલી કેટેગરી અને ટેગ આર્કાઈવ્સ','Select taxonomies to enable SEO options for them and include them in the sitemap.'=>'તેમના માટે SEO વિકલ્પો સક્ષમ કરવા વર્ગીકરણ પસંદ કરો અને તેમને સાઇટમેપમાં શામેલ કરો.','Public Taxonomies'=>'જાહેર વર્ગીકરણ','Select post types to enable SEO options for them and include them in the sitemap.'=>'પોસ્ટ પ્રકારો પસંદ કરીને તેમના માટે SEO વિકલ્પો સક્ષમ કરો અને તેમને સાઇટમેપમાં શામેલ કરો.','Public Post Types'=>'જાહેર પોસ્ટના પ્રકારો','Include reference to images from the post content in sitemaps. This helps search engines index your images better.'=>'સાઇટમેપ્સમાં પોસ્ટ સામગ્રીમાંથી છબીઓનો સંદર્ભ શામેલ કરો. આ સર્ચ એન્જિનને તમારી છબીઓને વધુ સારી રીતે ઇન્ડેક્સ કરવામાં મદદ કરે છે.','Include Images'=>'છબીઓ શામેલ કરો','XML Sitemaps help search engines index your website&#039;s content more effectively.'=>'XML સાઇટમેપ્સ સર્ચ એન્જિનને તમારી વેબસાઇટની સામગ્રીને વધુ અસરકારક રીતે ઇન્ડેક્સ કરવામાં મદદ કરે છે.','Sitemaps'=>'સાઇટમેપ્સ','Search Console'=>'સર્ચ કંસોલ','Default Social Share Image'=>'ડિફૉલ્ટ સોશિયલ શેર છબી','Logo for Google'=>'ગૂગલ માટે લોગો','Select the type that best describes your business. If you can\'t find one that applies exactly, use the generic "Organization" or "Local Business" types.'=>'તમારા વ્યવસાયનું શ્રેષ્ઠ વર્ણન કરતો પ્રકાર પસંદ કરો. જો તમને બરાબર લાગુ પડત